import { Link } from 'react-router-dom';
import React from 'react';

/*
ITP 404, Final
Author: Carson Wang
Email: carsonw@usc.edu
Navigation Bar to display on top of every page
*/

export default function Navigation() {
  return (
    // Primary navigation container
    <div className="navigationBar">
      {/* Ensures consistent spacing and layout */}
      <div className="nav-container">
        {/* Logo and brand name with link to homepage */}
        <div className="logo">
          <Link to="/" className="logo">
            PeakPulse
          </Link>
        </div>

        <div className="subpages">
          {/* Link to the About page */}
          <a className="item">
            <Link to="/" className="item">
              About
            </Link>
          </a>

          {/* Link to the All Resort page */}
          <a className="item">
            <Link to="/userFAQ" className="item">
              All Resorts
            </Link>
          </a>

          {/* Link to the Saved page */}
          <a className="item">
            <Link to="/userFAQ" className="item">
              Saved Resorts
            </Link>
          </a>

          {/* Link to the Contact page */}
          <a className="item">
            <Link to="/userFAQ" className="item">
              Contact Us
            </Link>
          </a>
        </div>
      </div>
    </div>
  );
}
